import React from 'react';
import './About.css'; // Arquivo com os estilos

const About = () => {
  return (
    <section id="about">
      <div className="about-photo">
        <img src="sua-foto.jpg" alt="Minha Foto" />
      </div>
      <div className="about-text">
        <h1>Sobre Mim</h1>
        <p>
          Olá, meu nome é [Seu Nome], e sou apaixonado(a) por tecnologia e desenvolvimento. 
          Tenho experiência em [áreas de especialização] e adoro criar projetos que resolvam problemas reais.
        </p>
        <p>
          Além de programar, gosto de [seus hobbies]. Meu objetivo é continuar aprendendo e me desafiando 
          para crescer cada vez mais na carreira.
        </p>
      </div>
    </section>
  );
};

export default About;
